Mongoose update multiple fields in one document in nodejs<p>I've a collection of ranks in ship. It has <strong>rank</strong> and <strong>type</strong>.</p>
<p>Some of the ranks and their corresponding types are:</p>
<ol>
<li>BOSUN -&gt; Crew</li>
<li>OS -&gt; Crew</li>
<li>FITTER -&gt; Crew</li>
</ol>
<p>and some other officer types. User can edit both rank and types(If there's typo or the rank is in wrong type). But I just find the correct mongoose way to do so. This is what I've tried</p>
<pre><code>const editOneRank = async (req, res) =&gt; {
    const rank = req.body.rank;
    const rankData = await Rank.findOne({rank});
    console.log(rankData);
    if(!rankData){
        res.status(200).send({
            message: &quot;rank not found&quot;,
        })
    }else{
        const editedRankFromBody = new Rank({
            rank: req.body.rank,
            type: req.body.type
        });

        try{
            await Rank.findOneAndUpdate(rankData._id, {&quot;rank&quot;: req.body.rank,&quot;type&quot;: req.body.type}, (err, result)=&gt;{
                if(err){
                    res.status(400).send({
                        data: &quot;couldn't update rank&quot;
                    })
                }else{
                    console.log(result);
                    res.status(200).send({
                        data: &quot;Rank Updated&quot;
                    })
                }
            })
        }catch(err){
            res.status(400).send({
                data: err+ &quot;hello&quot;
            })
        }
    }
}
</code></pre>
<p>But it doesn't update anything I also tried:</p>
<pre><code>await Rank.findOneAndUpdate(rankData._id, {&quot;type&quot;: req.body.type}, (err, result)=&gt;{})
</code></pre>
<p>with no luck. What am I doing wrong? How do I update both rank and type if somehow the user needs to update both?</p>

