MongoDB geoNear not working for some coordinates but working for others<p>I'm working on an API using MongoDB and the Node.js driver for mongoDB. One of the routes takes in coordinates and calls an aggregation pipeline that returns results sorted by closeness and a number of other factors. The code for the first step of the pipeline is:</p>
<pre><code>{$geoNear:{
  near:{
     type: &quot;Point&quot;,
     coordinates: [lat, long]
  },
  spherical:true,
  distanceField:&quot;distance&quot;
}},
</code></pre>
<p>This was working fine until all of the sudden, it wasn't. Now it works for some coordinates and for others it gives the error <code>MongoError: invalid argument in geo near query: type</code>. It works fine with <code>{lat:0, long:0}</code>, fine with <code>{lat:40.7411, long:-73.9897}</code>, fine with <code>{lat:46.68758191106798, long:2.8106467331441767}</code>, but gives the error with <code>{lat:37.785834, long:-122.406417}</code> and <code>{lat:47.643628614308675, long:-122.34560056016635}</code>. The only pattern I can find is that it hates coordinates on the West Coast. I've verified that the 2d-sphere index is still there on the data. I've tried setting spherical to false. I've even tried deleting all the data, and still get the same behavior even with an empty  collection. I'm truly mystified as to why the argument to geonear would be valid for some points and not for others.</p>
<p>Edit: I've now commented out everything except for the following code and I'm still getting the same behavior where some coordinates work and others give <code>MongoError: invalid argument in geo near query: type</code></p>
<pre><code>router.post(&quot;/&quot;, asyncHandler(async (req, res, next) =&gt; {
    const {lat, long} = req.body;
    const errors = [];
    if(typeof(lat) !== &quot;number&quot; || Math.abs(lat) &gt; 90) errors.push(&quot;Lat is invalid&quot;);
    if(typeof(long) !== &quot;number&quot; || Math.abs(long) &gt; 180) errors.push(&quot;Long is invalid&quot;);
    if(errors.length) return next(errors);
    const feed = await req.app.locals.db.collection(&quot;posts&quot;).aggregate(
        [
            {$geoNear:{
                near:{
                    type: &quot;Point&quot;,
                    coordinates: [lat, long]
                },
                spherical:true,
                distanceField:&quot;distance&quot;
            }},
        ]
    );
    const feedArr = await feed.toArray();
    res.json(feedArr);
}));
</code></pre>

