Adding a validator to an existing schema with mongoose<p>I have a mongoose schema that looks like this:</p>
<pre><code>const userSchema = new Schema({
    username: {
        type: String,
        required: true,
        unique: true,
        minlength: 4,
        maxlength: 20,
        validate: {
            validator: username =&gt; !username.startsWith('banned_prefix')
            msg: 'This username is invalid',
            type: 'username-validation-1'
        }
    }
});
</code></pre>
<p>I want the schema to look like this:</p>
<pre><code>const userSchema = new Schema({
    username: {
        type: String,
        required: true,
        unique: true,
        minlength: 4,
        maxlength: 20,
        validate: [
            {
                validator: username =&gt; !username.startsWith('banned_prefix')
                msg: 'This username is invalid',
                type: 'username-validation-1'
            },
            {
                validator: username =&gt; !username.startsWith('new_banned_prefix')
                msg: 'This username is invalid',
                type: 'username-validation-2'
            }
        ]
    }
});
</code></pre>
<p>How do I do this given that the database and schema already exist and I don't want to completely delete and reset the db?</p>
<p>I tried writing a migration using the native mongodb node driver based on <a href="https://docs.mongodb.com/manual/core/schema-validation/#existing-documents" rel="nofollow noreferrer">https://docs.mongodb.com/manual/core/schema-validation/#existing-documents</a>. However, it seems like mongoose doesn't actually add native mongodb validators for the validators specified in the schema. That is, when I printed out the validator data for the collection, I get an empty object:</p>
<pre><code>// prints {}
console.log((await db.listCollections({ name: 'users' }).toArray())[0].options.validator);
</code></pre>
<p>I don't want to add this new validator in a way that makes it different from the existing validators I have on the schema.</p>

